import React from "react";

function DarkMood() {
  return (
    <>
      <header
        style={{
          display: "flex",
          //   border: "1px solid",
          justifyContent: "space-between",
          padding: "10px 10px",
        }}
      >
        <h1 style={{ margin: "0px" }}>DarkMood</h1>
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            width: "40%",
          }}
        >
          <h4 style={{ marginTop: "px" }}>Home</h4>
          <h4 style={{ marginTop: "px" }}>About</h4>
          <h4 style={{ marginTop: "px" }}>Services</h4>
        </div>
      </header>

      <main>
        <section
          style={{
            display: "flex",
            justifyContent: "space-between",
            border: "1px solid",
            gap: "20px",
          }}
        >
          <div style={{ width: "50%", border: "1px solid",padding:"30px" }}>
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Tempora
              laboriosam ut hic nobis ab excepturi assumenda provident neque
              eligendi, esse aliquam accusamus labore incidunt beatae quibusdam
              ipsa! Velit, a eum!
            </p>
          </div>
          <div style={{ width: "50%", border: "1px solid" }}>
            <img src="https://images.unsplash.com/photo-1665323759004-43c9f3b941dc?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHwyfHx8ZW58MHx8fHw%3D&auto=format&fit=crop&w=500&q=60" alt="" />
          </div>
        </section>
      </main>
    </>
  );
}

export default DarkMood;
